import { createMuiTheme } from "@material-ui/core/styles";

const fixBlue = "#0B72B9";
const fixOrange = "#FF7F50";

export default createMuiTheme({
  palette: {
    common: {
      fixBlue: `${fixBlue}`,
      fixOrange: `${fixOrange}`,
    },
    primary: {
      main: `${fixBlue}`,
    },
    secondary: {
      main: `${fixOrange}`,
    },
  },
});
